import React from 'react';
import { TextField, MenuItem, Button, Checkbox, FormControlLabel } from '@mui/material';

const Filters = ({ filters, setFilters, onApplyFilters }) => {
  const handleFilterChange = (name, value) => {
    setFilters((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <div style={{ display: 'flex', flexWrap: 'wrap', gap: '10px' }}>
      {/* Date Range Filters */}
      <TextField
        label="Start Date"
        type="date"
        value={filters.startDate || ''}
        onChange={(e) => handleFilterChange('startDate', e.target.value)}
        InputLabelProps={{ shrink: true }}
      />
      <TextField
        label="End Date"
        type="date"
        value={filters.endDate || ''}
        onChange={(e) => handleFilterChange('endDate', e.target.value)}
        InputLabelProps={{ shrink: true }}
      />

      {/* Amount Range Filters */}
      <TextField
        label="Min Amount"
        type="number"
        value={filters.minAmount || ''}
        onChange={(e) => handleFilterChange('minAmount', e.target.value)}
      />
      <TextField
        label="Max Amount"
        type="number"
        value={filters.maxAmount || ''}
        onChange={(e) => handleFilterChange('maxAmount', e.target.value)}
      />

      {/* Pay Type Filter */}
      <TextField
        select
        label="Pay Type"
        value={filters.paytypeId || ''}
        onChange={(e) => handleFilterChange('paytypeId', e.target.value)}
      >
        <MenuItem value="1">Cash</MenuItem>
        <MenuItem value="2">Check</MenuItem>
        <MenuItem value="3">Visa</MenuItem>
        {/* Add more options as needed */}
      </TextField>

      {/* Provider Filter */}
      <TextField
        label="Provider"
        value={filters.providerId || ''}
        onChange={(e) => handleFilterChange('providerId', e.target.value)}
      />

      {/* Employee Type Filter */}
      <TextField
        label="Employee Type"
        value={filters.employeeTypeId || ''}
        onChange={(e) => handleFilterChange('employeeTypeId', e.target.value)}
      />

      {/* Exclude Non-Positive Amounts */}
      <FormControlLabel
        control={
          <Checkbox
            checked={filters.excludeNonPositive || false}
            onChange={(e) => handleFilterChange('excludeNonPositive', e.target.checked)}
          />
        }
        label="Exclude Non-Positive Amounts"
      />

      {/* Apply Filters */}
      <Button variant="contained" onClick={onApplyFilters}>
        Apply Filters
      </Button>
    </div>
  );
};

export default Filters;
